import React from 'react';
import circular from "../assets/circle.png";

export default function CircularGraph() {
  return (
    <div>
        <img style={{ width:"220px",boxShadow: "rgba(0, 0, 0, 0.24) 0px 3px 8px",borderRadius: "0.5rem",height:"205px"}} src={circular} alt='circulargraph'/>
    </div>
  )
}
